import './App.css';
import Nav from './components/Nav';
import { BrowserRouter as Brouter } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    <Brouter>
    <div className="App">
      <header className="App-header">
        <Nav />
        <p>
          First React app!
        </p>
      </header>
    </div>
    </Brouter>
  );
}

export default App;
